The Umbrellas of Cherbourg

=======

Catherine Deneuve plays an umbrella-shop owner's delicate daughter, glowing with
first love for a handsome garage mechanic, played by Nino Castelnuovo. When the
boy is shipped off to fight in Algeria, the two lovers must grow up quickly. 

Exquisitely designed in a kaleidoscope of colors, and told entirely through the
lilting songs of the great composer Michel Legrand, The Umbrellas of Cherbourg
is one of the most revered and unorthodox movie musicals of all time.

